const Searchbar = ({ heading, subheading, placeholder, on }) => {
  return (
    <div id="search-bar">
      <h5 className="text-center">{heading}</h5>
      <p className="text-center">{subheading}</p>
      <input className="form-control text-center w-50 mx-auto" type="text" placeholder={placeholder}/>
    </div>
  )
}

export default Searchbar;
